import React from 'react'
import style from '../Form/Form.module.scss'

class Form extends React.Component{
  render() {
    console.log(this.props)
	const {formCallback} = this.props;
    return(
	  <form className={style.form} onSubmit={formCallback}>
		{this.props.children}
	  </form>
	)
  }
}
export default Form
